/* eslint-disable */
<template>
	<div class="amap-page-container">
		<div :style="{width:'100%',height:'300px'}">
			<el-amap vid="amap" :plugin="plugin" class="amap-demo" :center="center">
			</el-amap>
		</div>
	</div>
</template>

<script>
	export default {
		data() {
			const self = this;
			return {
				features: ['bg', 'road'],
				resizeEnable: true,
				center: [116.397428, 39.90923],
				zoom: 11,
				viewMode: '2D',
				pitch: 50,
				showZoomBar: true,
				plugin: [{
					radius: 25,
					opacity: [0, 0.8],
					dataSet: [],
				}]
			}
		},

	}
</script>

<style>
	.amap-demo {
		height: 300px;
	}
</style>
